  `bride_mobile` char(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '新娘手机',
  `bridegroom_wechat` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '新郎微信',
  `bride_wechat` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '新娘微信',
  `home_address` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '家庭住址',
  `idcard` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '身份证号',
  `status` int(11) DEFAULT NULL COMMENT '订单完成状态',
  `check_status` int(11) DEFAULT 0 COMMENT '审核状态',
  `check_status_source` int(11) NOT NULL DEFAULT 0 COMMENT '渠道审核状态',
  `check_remark_source` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '渠道审核备注',
  `check_status_score` int(11) NOT NULL DEFAULT 0 COMMENT '积分审核状态',
  `check_remark_score` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '积点审核备注',
  `check_status_contract_fiance` int(11) NOT NULL DEFAULT 0 COMMENT '财务合同审核状态',
  `check_remark_contract_fiance` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `check_status_receivables_cashier` int(11) NOT NULL DEFAULT 0 COMMENT '出纳收款审核',
  `check_remark_receivables_cashier` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `check_status_payment_account` int(11) NOT NULL DEFAULT 0 COMMENT '会计付款审核',
  `check_remark_payment_account` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `check_status_payment_fiance` int(11) NOT NULL DEFAULT 0 COMMENT '财务付款审核',
  `check_remark_payment_fiance` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `check_status_payment_cashier` int(11) NOT NULL DEFAULT 0 COMMENT '出纳付款审核',
  `check_remark_payment_cashier` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `prepay_money` decimal(10, 2) DEFAULT NULL COMMENT '意向金',
  `earnest_money_date` int(11) DEFAULT NULL COMMENT '定金收款日期',
  `earnest_money` decimal(10, 2) DEFAULT NULL COMMENT '定金收款金额',
  `middle_money_date` int(11) DEFAULT NULL COMMENT '中款收款日期',
  `middle_money` decimal(10, 2) DEFAULT NULL COMMENT '中款收款金额',
  `tail_money_date` int(11) DEFAULT NULL COMMENT '尾款收款日期',
  `tail_money` decimal(10, 2) DEFAULT NULL COMMENT '尾款收款金额',
  `contract_totals` decimal(10, 2) DEFAULT NULL COMMENT ' 合同总金额',
  `create_time` int(11) NOT NULL DEFAULT 0,
  `delete_time` int(11) NOT NULL DEFAULT 0,
  `update_time` int(11) NOT NULL DEFAULT 0,
  `totals` decimal(10, 2) NOT NULL DEFAULT 0.00,
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '订单备注',
  `sale` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '销售员',
  `sale_commission` decimal(10, 2) DEFAULT NULL COMMENT '销售提成',
  `source_fee` decimal(10, 2) DEFAULT NULL COMMENT '渠道费用',
  `person_source_fee` decimal(10, 2) DEFAULT NULL COMMENT '个人渠道费用',
  `pay_hotel_admission_fee` decimal(10, 2) DEFAULT NULL COMMENT '付酒店进场费',
  `income_wedding_celebration_admission_fee` decimal(10, 2) DEFAULT NULL COMMENT '收婚庆进场费',
  `pay_hotel_fee` decimal(10, 2) DEFAULT NULL COMMENT '付酒店费用',
  `brand_text` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '品牌',
  `complete` int(11) NOT NULL DEFAULT 0 COMMENT '完成状态',
  `banquet_commission` decimal(10, 2) DEFAULT NULL COMMENT '婚宴提成',
  `wedding_commission` decimal(10, 2) DEFAULT NULL COMMENT '婚庆提成',
  `hotel_totals` decimal(10, 2) DEFAULT NULL COMMENT '酒店结算',
  `image` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin COMMENT '图集',
  `receipt_img` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin COMMENT '收据图片',
  `note_img` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin COMMENT '小票或收款截图照片',
  `user_id` int(11) DEFAULT 0,
  `item_check_status` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2599 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = Dynamic;

